// Função para carregar um script dinamicamente e nos avisar quando estiver pronto
function loadScript(src, callback) {
  // Verifica se o script já existe na página para não carregar de novo
  const existingScript = document.querySelector(`script[src="${src}"]`);
  if (existingScript) {
    callback();
    return;
  }

  const script = document.createElement('script');
  script.src = src;
  script.onload = () => callback(); // Só chama o callback DEPOIS que o script carregar
  script.onerror = () => console.error(`Erro ao carregar o script: ${src}`);
  document.head.appendChild(script);
}

// Função que desenha o nosso gráfico (nosso código antigo)
function drawChart() {
  // Uma pequena pausa para garantir que o canvas está pronto
  setTimeout(() => {
    if (window.myBiChart) {
      window.myBiChart.destroy();
    }
    
    const canvas = document.getElementById('biChart');
    if (!canvas) {
      console.error('Elemento canvas #biChart não encontrado.');
      return;
    }
    
    const ctx = canvas.getContext('2d');
    window.myBiChart = new Chart(ctx, {
      type: 'line',
      data: {
        labels: ['Jan', 'Fev', 'Mar', 'Abr', 'Mai', 'Jun'],
        datasets: [{
          label: 'Receita (R$)',
          data: [12000, 19000, 15000, 25000, 22000, 30000],
          borderColor: '#1CA9A6',
          backgroundColor: 'rgba(28, 169, 166, 0.1)',
          fill: true,
          tension: 0.4
        }, {
          label: 'Novos Clientes',
          data: [30, 45, 40, 55, 60, 75],
          borderColor: '#0B2A45',
          backgroundColor: 'rgba(11, 42, 69, 0.1)',
          fill: true,
          tension: 0.4
        }]
      },
      options: {
        responsive: true,
        plugins: { legend: { position: 'top' } }
      }
    });
  }, 100); // Espera 100 milissegundos
}

// O processo principal:
// 1. Tenta carregar a biblioteca Chart.js.
// 2. QUANDO terminar de carregar, executa a função para desenhar o gráfico.
loadScript('https://cdn.jsdelivr.net/npm/chart.js', drawChart);

